import productLogo from "./Beats/Icons/productLogo.png";
import rightArrow from "./Beats/Icons/rightArrow.png";
import shoppingBag from "./Beats/Icons/shoppingBag.png";
import specsLogo from "./Beats/Icons/specsLogo.png";
import twitter from "./Beats/Icons/twitter.png";
import upArrow from "./Beats/Icons/upArrow.png";

export const myContext = createContext("");

function App(value) {
  debugger;
  const menu = value["value"];
  console.log(menu);
  return (
    <>
      <section className="home-section">
        <nav className="navbar">
          <div className="logo">
            <img src={amazonLogo} alt="logo" />
          </div>
          <div className="right-nav">
            <ul>
              <li>
                {" "}
                <a href="#">Home</a>{" "}
              </li>
              <li>
                {" "}
                <a href="#specs">Specs</a>{" "}
              </li>
              <li>
                {" "}
                <a href="#case">Case</a>{" "}
              </li>
              <li>
                {" "}
                <a href="#products">Products</a>{" "}
              </li>
            </ul>
            <button className="nav-btn">Shop</button>
          </div>
        </nav>
        <div className="main-home">
          <div className="main-image">
            <img src={mainImage} alt="main-image" />
          </div>
          <div className="right-home">
            <img src={onEar} alt="image" id="onear-img" />
            <h1>Beats 3</h1>
            <h3>Overview</h3>
            <p>
              Enjoy award-winning Beats sound with wireless <br /> listening
              freedom and a sleek, steamlined design <br /> with comfortable
              padded earphones, delivering <br /> first-rate playback.
            </p>
            <button>
              <img src={shoppingBag} alt="bag-image" />
              Add to Bag
              <span>N399K</span>
            </button>
          </div>
        </div>
        <div className="company-logo">
          <img src={appleLogo} alt="apple-logo" />
          <img src={spotifyLogo} alt="spotify-logo" />
          <img src={amazonLogo} alt="amazon-logo" />
          <img src={youtubeLogo} alt="youtube-logo" />
        </div>
      </section>
      <section className="specs-section" id="specs">
        <div className="specs">
          <img src={specsLogo} alt="specs-logo-img" />
        </div>
        <div className="about-specs">
          <div className="specification">
            <div className="connection">
              <img src={bluetooth} alt="bluetooth-icon" />
              <h4>Connection</h4>
              <span>Bluetooth v5.2</span>
            </div>
            <div className="battery">
              <img src={battery} alt="battery-icon" />
              <h4>Battery</h4>
              <span>Duration 40h</span>
            </div>
            <div className="load">
              <img src={charger} alt="charger-icon" />
              <h4>Load</h4>
              <span>Fast charge 4.2-AAc</span>
            </div>
            <div className="microphone">
              <img src={mic} alt="battery-icon" />
              <h4>Microphone</h4>
              <span>
                Supports Apple Siri <br /> and Google
              </span>
            </div>
          </div>
          <div className="specs-big-img">
            <img src={specsImage} alt="specs-img" />
          </div>
        </div>
      </section>
      <section className="case-section" id="case">
        <div className="cases">
          <img src={caseLogo} alt="case-logo-img" />
        </div>
        <div className="about-case">
          <div className="case-img">
            <img src={caseImage} alt="case-img" />
          </div>
          <div className="right-case">
            <p>
              With a comfortable and <br /> adaptable case so that you <br />{" "}
              can store it whenever you <br /> want, and keep your durability{" "}
              <br /> forever.
            </p>
            <a href>
              <img src={group} alt="group-icon" />
              More info
            </a>
          </div>
        </div>
      </section>
      <section className="buynow-section">
        <div className="buynow-box">
          <div className="left-buynow">
            <h2>
              Immerse yourself in <br /> your music
            </h2>
            <p>Buy Now, up to 40% off</p>
            <a href>
              <img src={shoppingBag} alt="bag-image" />
              Buy now
            </a>
          </div>
          <div className="right-buynow">
            <img src={buyNowSectionImage} alt="buynow-image" />
          </div>
        </div>
      </section>

      <footer className="footer">
        <div className="footer-logo">
          <img src={beatsLogo} alt="logo" />
        </div>
        <div className="list">
          <h3>Proucts</h3>
          <ul>
            <li>
              {" "}
              <a href>Headphones</a>{" "}
            </li>
            <li>
              {" "}
              <a href>Earphones</a>{" "}
            </li>
            <li>
              {" "}
              <a href>Earbuds</a>{" "}
            </li>
            <li>
              {" "}
              <a href>Accessories</a>{" "}
            </li>
          </ul>
        </div>
        <div className="list support">
          <h3>Support</h3>
          <ul>
            <li>
              {" "}
              <a href>Product help</a>{" "}
            </li>
            <li>
              {" "}
              <a href>Register</a>{" "}
            </li>
            <li>
              {" "}
              <a href>Updates</a>{" "}
            </li>
            <li>
              {" "}
              <a href>Provides</a>{" "}
            </li>
          </ul>
        </div>
        <div className="right-last-footer">
          <div className="user-input">
            <input type="email" name="email" placeholder="Email" />
            <a href>
              <img src={rightArrow} alt="bag-image" />
              Subscribe
            </a>
          </div>
          <div className="social-icon">
            <img src={facebook} alt="fb-icon" />
            <img src={twitter} alt="twitter-icon" />
            <img src={instagram} alt="intsagram-img" />
            <img src={linkedin} alt="linkdin-img" />
          </div>
        </div>
      </footer>
    </>

    // { <myContext.Provider value={{ menu }}>
    // <div className="App">
    //   <Navbar />
    //   <Main />
    //   <Hero />
    //   <Footer />
    // </div>
    // </myContext.Provider> }
  );
}

export default App;
